plugins {
    id "org.jetbrains.intellij" version "0.2.17"
}

intellij {
    version 'IC-172.4574.11'
    pluginName 'IntellijEve'
}

group 'org.tub.eveamcp'
version '0.0.1'

sourceSets {
    main {
        resources {
            srcDir 'resources'
        }
    }
}

repositories {
    mavenCentral()
}

prepareSandbox {
    doLast {
        copy {
            from System.getProperty("user.home")+'/.IdeaIC2017.2/config/plugins/'
            into './build/idea-sandbox/plugins/'
        }
    }
}
